    "All learners who are enrolled in this course": "\u0f66\u0fb3\u0f7c\u0f56\u0f0b\u0f5a\u0f53\u0f0b\u0f60\u0f51\u0f72\u0f60\u0f72\u0f0b\u0f53\u0f44\u0f0b\u0f5e\u0f74\u0f42\u0f66\u0f0b\u0f50\u0f7c\u0f62\u0f0b\u0f56\u0f40\u0f7c\u0f51\u0f0b\u0f54\u0f60\u0f72\u0f0b\u0f66\u0fb3\u0f7c\u0f56\u0f0b\u0f42\u0f49\u0f7a\u0f62\u0f0b\u0f56\u0f0b\u0f61\u0f7c\u0f44\u0f66\u0f0d",
