    "Alternative source": "\u0f60\u0f51\u0fb2\u0f0b\u0f58\u0f5a\u0f74\u0f44\u0f66\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f41\u0f74\u0f44\u0f66\u0f0d",
    "An answer option has been left blank. Please review and edit the component.": "\u0f63\u0f53\u0f0b\u0f60\u0f51\u0f7a\u0f56\u0f66\u0f0b\u0f66\u0f60\u0f72\u0f0b\u0f60\u0f51\u0f7a\u0f58\u0f0b\u0f41\u0f0b\u0f5e\u0f72\u0f42\u0f0b\u0f66\u0f9f\u0f7c\u0f44\u0f0b\u0f56\u0f62\u0f0b\u0f56\u0f5e\u0f42\u0f0b\u0f60\u0f51\u0f74\u0f42 \u0f42\u0fb2\u0f74\u0f56\u0f0b\u0f46\u0f0b\u0f51\u0f7a\u0f0b\u0f63\u0f0b\u0f56\u0f66\u0f90\u0fb1\u0f62\u0f0b\u0f5e\u0f72\u0f56\u0f0b\u0f51\u0f44\u0f0b\u0f56\u0f66\u0f90\u0fb1\u0f62\u0f0b\u0f66\u0f92\u0fb2\u0f72\u0f42\u0f0b\u0f56\u0fb1\u0f0b\u0f62\u0f7c\u0f42\u0f66\u0f0d",
    "An error has occurred. Check your Internet connection and try again.": "\u0f42\u0f53\u0f51\u0f0b\u0f51\u0f7c\u0f53\u0f0b\u0f5e\u0f72\u0f42\u0f0b\u0f56\u0fb1\u0f74\u0f44\u0f0b\u0f66\u0f7c\u0f44\u0f0b\u0f0d \u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f51\u0fb2\u0f0b\u0f62\u0f92\u0fb1\u0f62\u0f0b\u0f42\u0f53\u0f51\u0f0b\u0f51\u0f7c\u0f53\u0f0b\u0f61\u0f7c\u0f51\u0f0b\u0f58\u0f7a\u0f51\u0f0b\u0f56\u0f63\u0f9f\u0f66\u0f0b\u0f62\u0f97\u0f7a\u0f66\u0f0d \u0f56\u0f66\u0f90\u0fb1\u0f62\u0f0b\u0f51\u0f74\u0f0b\u0f5a\u0f7c\u0f51\u0f0b\u0f63\u0f9f\u0f0b\u0f56\u0fb1\u0f7c\u0f66\u0f0d",
    "An error has occurred. Make sure that you are connected to the Internet, and then try refreshing the page.": "\u0f42\u0f53\u0f51\u0f0b\u0f51\u0f7c\u0f53\u0f0b\u0f5e\u0f72\u0f42\u0f0b\u0f56\u0fb1\u0f74\u0f44\u0f0b\u0f66\u0f7c\u0f44\u0f0b\u0f0d \u0f51\u0fb2\u0f0b\u0f62\u0f92\u0fb1\u0f62\u0f0b\u0f58\u0f50\u0f74\u0f51\u0f0b\u0f61\u0f7c\u0f51\u0f0b\u0f58\u0f7a\u0f51\u0f0b\u0f42\u0f4f\u0f53\u0f0b\u0f60\u0f41\u0f7a\u0f63\u0f0b\u0f56\u0fb1\u0f66\u0f0b\u0f4f\u0f7a\u0f0d \u0f51\u0fb2\u0f0b\u0f44\u0f7c\u0f66\u0f0b\u0f56\u0f66\u0f90\u0fb1\u0f62\u0f0b\u0f63\u0f7a\u0f53\u0f0b\u0f56\u0fb1\u0f66\u0f0b\u0f53\u0f66\u0f0b\u0f5a\u0f7c\u0f51\u0f0b\u0f63\u0f9f\u0f0b\u0f56\u0fb1\u0f7c\u0f66\u0f0d",
