    "Enrollment Mode": "\u0f5e\u0f74\u0f42\u0f66\u0f0b\u0f50\u0f7c\u0f60\u0f72\u0f0b\u0f62\u0fa3\u0f58\u0f0b\u0f54\u0f0d",
