    "Error starting a task to rescore problem '<%- problem_id %>'. Make sure that the problem identifier is complete and correct.": "\u0f51\u0fb2\u0f72\u0f0b\u0f56\u0f60\u0f72\u0f0b\u0f56\u0f62\u0f92\u0fb1\u0f0b\u0f46\u0f0b\u0f56\u0f66\u0f90\u0fb1\u0f62\u0f0b\u0f66\u0f90\u0f7c\u0f62\u0f0b\u0f42\u0fb1\u0f72\u0f0b\u0f63\u0f66\u0f0b\u0f51\u0f7c\u0f53\u0f0b\u0f66\u0f90\u0f56\u0f66\u0f0b\u0f42\u0f53\u0f51\u0f0b\u0f51\u0f7c\u0f53\u0f0b\u0f5e\u0f72\u0f42\u0f0b\u0f56\u0fb1\u0f74\u0f44\u0f0b\u0f66\u0f7c\u0f44\u0f0b\u0f0d '<%- problem_id %>'. \u0f51\u0fb2\u0f72\u0f0b\u0f56\u0f60\u0f72\u0f0b\u0f44\u0f7c\u0f66\u0f0b\u0f60\u0f5b\u0f72\u0f53\u0f0b\u0f56\u0fb1\u0f7a\u0f51\u0f0b\u0f51\u0f7a\u0f0b\u0f46\u0f0b\u0f5a\u0f44\u0f0b\u0f56\u0f0b\u0f51\u0f44\u0f0b\u0f61\u0f44\u0f0b\u0f51\u0f42\u0f0b\u0f54\u0f0b\u0f61\u0f7c\u0f44\u0f0b\u0f61\u0f7c\u0f51\u0f0b\u0f58\u0f7a\u0f51\u0f0b\u0f63\u0f7a\u0f42\u0f66\u0f0b\u0f54\u0f62\u0f0b\u0f62\u0f9f\u0f7c\u0f42",
    "Error starting a task to reset attempts for all students on problem '<%- problem_id %>'. Make sure that the problem identifier is complete and correct.": "\u0f51\u0fb2\u0f72\u0f0b\u0f56\u0f0b\u0f51\u0f7a\u0f60\u0f72\u0f0b\u0f66\u0f92\u0f44\u0f0b '<%- problem_id %>' \u0f42\u0f72\u0f0b\u0f66\u0fb3\u0f7c\u0f42\u0f0b\u0f55\u0fb2\u0f74\u0f42\u0f0b\u0f61\u0f7c\u0f44\u0f66\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f56\u0f66\u0f90\u0fb1\u0f62\u0f0b\u0f66\u0f92\u0fb2\u0f72\u0f42\u0f0b\u0f5a\u0f7c\u0f51\u0f0b\u0f63\u0f9f\u0f60\u0f72\u0f0b\u0f63\u0f66\u0f0b\u0f51\u0f7c\u0f53\u0f0b\u0f60\u0f42\u0f7c\u0f0b\u0f62\u0fa9\u0f7c\u0f58\u0f0b\u0f51\u0f74\u0f66\u0f0b\u0f42\u0f53\u0f51\u0f0b\u0f51\u0f7c\u0f53\u0f0b\u0f56\u0fb1\u0f74\u0f44\u0f0b\u0f66\u0f7c\u0f44\u0f0b\u0f0d \u0f51\u0fb2\u0f72\u0f0b\u0f56\u0f0b\u0f51\u0f7a\u0f60\u0f72\u0f0b\u0f44\u0f7c\u0f66\u0f0b\u0f60\u0f5b\u0f72\u0f53\u0f0b\u0f56\u0fb1\u0f7a\u0f51\u0f0b\u0f51\u0f7a\u0f0b\u0f46\u0f0b\u0f5a\u0f44\u0f0b\u0f56\u0f0b\u0f51\u0f44\u0f0b\u0f61\u0f44\u0f0b\u0f51\u0f42\u0f0b\u0f54\u0f0b\u0f61\u0f72\u0f53\u0f0b\u0f58\u0f72\u0f53\u0f0b\u0f63\u0f7a\u0f42\u0f66\u0f0b\u0f54\u0f62\u0f0b\u0f62\u0f9f\u0f7c\u0f42",
