    "If you leave, you can no longer post in this team's discussions.Your place will be available to another learner.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f55\u0fb1\u0f72\u0f62\u0f0b\u0f50\u0f7c\u0f53\u0f0b\u0f54\u0f0b\u0f61\u0f72\u0f53\u0f0b\u0f53\u0f0b\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f66\u0f0b\u0f5a\u0f7c\u0f42\u0f66\u0f0b\u0f46\u0f74\u0f44\u0f0b\u0f60\u0f51\u0f72\u0f60\u0f72\u0f0b\u0f42\u0fb3\u0f7a\u0f44\u0f0b\u0f66\u0f9f\u0f7a\u0f42\u0f66\u0f0b\u0f66\u0f9f\u0f7a\u0f44\u0f0b\u0f62\u0fa9\u0f7c\u0f58\u0f0b\u0f61\u0f72\u0f42\u0f0b\u0f66\u0fa4\u0f7a\u0f63\u0f0b\u0f58\u0f72\u0f0b\u0f50\u0f74\u0f56\u0f0b\u0f45\u0f72\u0f44\u0f0b\u0f0d \u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f64\u0f74\u0f63\u0f0b\u0f61\u0f44\u0f0b\u0f66\u0fb3\u0f7c\u0f56\u0f0b\u0f58\u0f0b\u0f42\u0f5e\u0f53\u0f0b\u0f5e\u0f72\u0f42\u0f0b\u0f63\u0f0b\u0f50\u0f7c\u0f56\u0f0b\u0f60\u0f42\u0fb2\u0f7c\u0f0d",
    "If you make significant changes, make sure you notify members of the team before making these changes.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f66\u0f0b\u0f42\u0f63\u0f0b\u0f46\u0f7a\u0f60\u0f72\u0f0b\u0f56\u0f66\u0f92\u0fb1\u0f74\u0f62\u0f0b\u0f56\u0f45\u0f7c\u0f66\u0f0b\u0f56\u0fb1\u0f7a\u0f51\u0f0b\u0f53\u0f0b\u0f5a\u0f7c\u0f42\u0f66\u0f0b\u0f58\u0f72\u0f0b\u0f62\u0fa3\u0f58\u0f66\u0f0b\u0f63\u0f0b\u0f44\u0f7a\u0f66\u0f0b\u0f54\u0f62\u0f0b\u0f51\u0f74\u0f0b\u0f66\u0f94\u0f7c\u0f53\u0f0b\u0f56\u0f62\u0fa1\u0f0b\u0f42\u0f4f\u0f7c\u0f44\u0f0b\u0f51\u0f42\u0f7c\u0f66\u0f0d",
