    "If you still wish to continue and delete your account, please enter your account password:": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f51\u0f0b\u0f51\u0f74\u0f44\u0f0b\u0f62\u0f92\u0fb1\u0f74\u0f53\u0f0b\u0f58\u0f50\u0f74\u0f51\u0f0b\u0f62\u0f92\u0fb1\u0f74\u0f0b\u0f51\u0f44\u0f0b\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f41\u0f0b\u0f56\u0fb1\u0f44\u0f0b\u0f51\u0f7a\u0f0b\u0f56\u0f66\u0f74\u0f56\u0f0b\u0f60\u0f51\u0f7c\u0f51\u0f0b\u0f53\u0f0d \u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f41\u0f0b\u0f56\u0fb1\u0f44\u0f0b\u0f42\u0f72\u0f0b\u0f42\u0f66\u0f44\u0f0b\u0f68\u0f44\u0f0b\u0f60\u0f47\u0f74\u0f42\u0f0b\u0f62\u0f7c\u0f42\u0f66\u0f0d",
