    "Please do not use any spaces in this field.": "\u0f62\u0f72\u0f42\u0f0b\u0f5a\u0f53\u0f0b\u0f60\u0f51\u0f72\u0f60\u0f72\u0f0b\u0f53\u0f44\u0f0b\u0f54\u0f62\u0f0b\u0f66\u0f9f\u0f7c\u0f44\u0f0b\u0f42\u0f44\u0f0b\u0f61\u0f44\u0f0b\u0f58\u0f0b\u0f60\u0f47\u0f7c\u0f42\u0f0b\u0f62\u0f7c\u0f42\u0f66\u0f0d",
    "Please do not use any spaces or special characters in this field.": "\u0f62\u0f72\u0f42\u0f0b\u0f5a\u0f53\u0f0b\u0f60\u0f51\u0f72\u0f60\u0f72\u0f0b\u0f53\u0f44\u0f0b\u0f51\u0f58\u0f72\u0f42\u0f66\u0f0b\u0f56\u0f66\u0f63\u0f0b\u0f61\u0f72\u0f42\u0f0b\u0f60\u0f56\u0fb2\u0f74\u0f0b\u0f51\u0f44\u0f0b\u0f61\u0f44\u0f0b\u0f53\u0f0b\u0f54\u0f62\u0f0b\u0f66\u0f9f\u0f7c\u0f44\u0f0b\u0f42\u0f44\u0f0b\u0f61\u0f44\u0f0b\u0f58\u0f0b\u0f60\u0f47\u0f7c\u0f42\u0f0b\u0f62\u0f7c\u0f42\u0f66\u0f0d",
    "Please enter a problem location.": "\u0f51\u0f7c\u0f42\u0f66\u0f0b\u0f60\u0f51\u0fb2\u0f72\u0f60\u0f72\u0f0b\u0f66\u0f0b\u0f42\u0f53\u0f66\u0f0b\u0f64\u0f72\u0f42\u0f0b\u0f60\u0f47\u0f74\u0f42\u0f0b\u0f62\u0f7c\u0f42\u0f66\u0f0d",
