    "Please enter a student email address or username.": "\u0f66\u0fb3\u0f7c\u0f56\u0f0b\u0f58\u0f60\u0f72\u0f0b\u0f66\u0fa4\u0fb1\u0f7c\u0f51\u0f0b\u0f58\u0f72\u0f44\u0f0b\u0f51\u0f44\u0f0b\u0f42\u0fb3\u0f7c\u0f42\u0f0b\u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f42\u0f44\u0f0b\u0f62\u0f74\u0f44\u0f0b\u0f5e\u0f72\u0f42\u0f0b\u0f60\u0f47\u0f7c\u0f42\u0f0b\u0f62\u0f7c\u0f42\u0f66\u0f0d",
    "Please enter a term in the {anchorStart} search field{anchorEnd}.": "\u0f60\u0f5a\u0f7c\u0f63\u0f0b\u0f42\u0f53\u0f66\u0f0b\u0f66\u0f74\u0f0b\u0f56\u0f59\u0f63\u0f0b\u0f56\u0fb1\u0f60\u0f72\u0f0b\u0f5a\u0f72\u0f42\u0f0b\u0f55\u0fb2\u0f72\u0f66\u0f0b {anchorStart} \u0f60\u0f5a\u0f7c\u0f63\u0f0b\u0f42\u0f53\u0f66\u0f0d{anchorEnd}.",
    "Please enter a username or email.": "\u0f66\u0fa4\u0fb1\u0f7c\u0f51\u0f0b\u0f58\u0f41\u0f53\u0f0b\u0f42\u0fb1\u0f72\u0f0b\u0f58\u0f72\u0f44\u0f0b\u0f5e\u0f72\u0f42\u0f0b\u0f51\u0f44\u0f0b\u0f61\u0f44\u0f0b\u0f53\u0f0b\u0f42\u0fb3\u0f7c\u0f42\u0f0b\u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f53\u0f44\u0f0b\u0f60\u0f47\u0f74\u0f42\u0f0b\u0f56\u0fb1\u0f7c\u0f66\u0f0d",
