    "Please enter an integer between 0 and 100.": "0 \u0f53\u0f66\u0f0b 100 \u0f56\u0f62\u0f0b\u0f42\u0fb1\u0f72\u0f0b\u0f67\u0fb2\u0f72\u0f63\u0f0b\u0f42\u0fb2\u0f44\u0f66\u0f0b\u0f64\u0f72\u0f42\u0f0b\u0f5e\u0f7c\u0f42",
    "Please enter an integer greater than 0.": "0 \u0f63\u0f66\u0f0b\u0f58\u0f44\u0f0b\u0f56\u0f60\u0f72\u0f0b\u0f67\u0fb2\u0f72\u0f63\u0f0b\u0f42\u0fb2\u0f44\u0f66\u0f0b\u0f64\u0f72\u0f42\u0f0b\u0f5e\u0f7c\u0f42",
    "Please enter non-negative integer.": "\u0f51\u0f42\u0f42\u0f0b\u0f5a\u0f72\u0f42\u0f0b\u0f58\u0f7a\u0f51\u0f0b\u0f54\u0f60\u0f72\u0f0b\u0f67\u0fb2\u0f72\u0f63\u0f0b\u0f42\u0fb2\u0f44\u0f66\u0f0b\u0f64\u0f72\u0f42\u0f0b\u0f5e\u0f7c\u0f42",
