    "Please enter your %(field)s.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b%(field)s\u0f53\u0f44\u0f0b\u0f60\u0f47\u0f74\u0f42\u0f0b\u0f56\u0fb1\u0f7c\u0f66\u0f0d",
    "Please fix the following errors:": "\u0f42\u0f64\u0f58\u0f0b\u0f42\u0fb1\u0f72\u0f0b\u0f53\u0f7c\u0f62\u0f0b\u0f60\u0f41\u0fb2\u0f74\u0f63\u0f0b\u0f62\u0fa3\u0f58\u0f66\u0f0b\u0f56\u0f45\u0f7c\u0f66\u0f0b\u0f62\u0f7c\u0f42\u0f66\u0f0d",
    "Please note: Deletion of your account and personal data is permanent and cannot be undone. {platformName} will not be able to recover your account or the data that is deleted.": "\u0f42\u0f5f\u0f56\u0f0b\u0f53\u0f53\u0f0b\u0f56\u0fb1\u0f7a\u0f51\u0f0b\u0f51\u0f42\u0f7c\u0f66\u0f0b\u0f54\u0f0b\u0f5e\u0f72\u0f42\u0f0b\u0f53\u0f72\u0f0d \u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f41\u0f0b\u0f56\u0fb1\u0f44\u0f0b\u0f51\u0f44\u0f0b\u0f66\u0f92\u0f7a\u0f62\u0f0b\u0f42\u0fb1\u0f72\u0f0b\u0f42\u0f5e\u0f72\u0f0b\u0f42\u0fb2\u0f44\u0f66\u0f0b\u0f56\u0f66\u0f74\u0f56\u0f0b\u0f53\u0f0b\u0f42\u0f4f\u0f53\u0f0b\u0f51\u0f74\u0f0b\u0f56\u0f66\u0f74\u0f56\u0f0b\u0f60\u0f42\u0fb2\u0f7c\u0f0b\u0f56\u0f66\u0f0d \u0f56\u0f66\u0f90\u0fb1\u0f62\u0f0b\u0f42\u0f66\u0f7c\u0f0b\u0f56\u0fb1\u0f0b\u0f58\u0f72\u0f0b\u0f50\u0f74\u0f56\u0f0d {platformName} \u0f60\u0f51\u0f72\u0f66\u0f0b\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f66\u0f0b\u0f56\u0f66\u0f74\u0f56\u0f66\u0f0b\u0f5f\u0f72\u0f53\u0f0b\u0f54\u0f60\u0f72\u0f0b\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f41\u0f0b\u0f56\u0fb1\u0f44\u0f0b\u0f51\u0f44\u0f0b\u0f61\u0f44\u0f0b\u0f53\u0f0b\u0f42\u0f5e\u0f72\u0f0b\u0f42\u0fb2\u0f44\u0f66\u0f0b\u0f42\u0f44\u0f0b\u0f61\u0f72\u0f53\u0f0b\u0f62\u0f74\u0f44\u0f0b\u0f56\u0f66\u0f90\u0fb1\u0f62\u0f0b\u0f42\u0f66\u0f7c\u0f0b\u0f56\u0fb1\u0f0b\u0f58\u0f72\u0f0b\u0f50\u0f74\u0f56\u0f0d",
    "Please provide a description of the link destination.": "\u0f51\u0fb2\u0f0b\u0f50\u0f42\u0f0b\u0f58\u0f50\u0f74\u0f51\u0f0b\u0f42\u0f53\u0f66\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f60\u0f42\u0fb2\u0f7a\u0f63\u0f0b\u0f56\u0f64\u0f51\u0f0b\u0f45\u0f72\u0f42\u0f0b\u0f58\u0f41\u0f7c\u0f0b\u0f66\u0fa4\u0fb2\u0f7c\u0f51\u0f0b\u0f42\u0f53\u0f44\u0f0b\u0f62\u0f7c\u0f42\u0f66\u0f0d",
    "Please provide a valid URL.": "\u0f5a\u0f74\u0f63\u0f0b\u0f58\u0f50\u0f74\u0f53\u0f0b\u0f42\u0fb1\u0f72\u0f0bURL \u0f60\u0f47\u0f7c\u0f42\u0f0b\u0f62\u0f7c\u0f42\u0f66\u0f0d",
