    "Please specify a reason.": "\u0f62\u0f92\u0fb1\u0f74\u0f0b\u0f58\u0f5a\u0f53\u0f0b\u0f5e\u0f72\u0f42\u0f0b\u0f44\u0f7c\u0f66\u0f0b\u0f60\u0f5b\u0f72\u0f53\u0f0b\u0f62\u0f7c\u0f42\u0f66\u0f0d",
    "Please verify that you have uploaded a valid image (PNG and JPEG).": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f66\u0f0b\u0f53\u0f44\u0f0b\u0f60\u0f47\u0f74\u0f42\u0f0b\u0f56\u0fb1\u0f66\u0f0b\u0f54\u0f60\u0f72\u0f0b\u0f54\u0f62\u0f0b\u0f51\u0f7a\u0f0b\u0f5a\u0f74\u0f63\u0f0b\u0f58\u0f50\u0f74\u0f53\u0f0b\u0f5e\u0f72\u0f42\u0f0b\u0f61\u0f72\u0f53\u0f0b\u0f58\u0f72\u0f53\u0f0b\u0f56\u0f63\u0f9f\u0f0b\u0f62\u0f7c\u0f42\u0f66\u0f0d (PNG \u0f51\u0f44\u0f0b JPEG)",
    "Please verify that your webcam is connected and that you have allowed your browser to access it.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f56\u0f62\u0f99\u0f53\u0f0b\u0f58\u0f72\u0f42\u0f0b\u0f51\u0f7a\u0f0b\u0f66\u0fa6\u0fb2\u0f7a\u0f63\u0f0b\u0f58\u0f50\u0f74\u0f51\u0f0b\u0f63\u0f7a\u0f42\u0f66\u0f0b\u0f54\u0f62\u0f0b\u0f56\u0fb1\u0f66\u0f0b\u0f61\u0f7c\u0f51\u0f0b\u0f58\u0f7a\u0f51\u0f0b\u0f51\u0f44\u0f0b\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f66\u0f0b\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f56\u0f63\u0f9f\u0f0b\u0f56\u0f64\u0f7a\u0f62\u0f0b\u0f51\u0fb2\u0f0b\u0f5a\u0f72\u0f42\u0f66\u0f0b\u0f51\u0f7a\u0f0b\u0f63\u0f0b\u0f56\u0f62\u0f99\u0f53\u0f0b\u0f58\u0f72\u0f42\u0f0b\u0f66\u0f92\u0fb2\u0f72\u0f42\u0f0b\u0f66\u0fa6\u0fb1\u0f7c\u0f62\u0f0b\u0f42\u0fb1\u0f72\u0f0b\u0f46\u0f7c\u0f42\u0f0b\u0f58\u0f46\u0f53\u0f0b\u0f66\u0fa4\u0fb2\u0f51\u0f0b\u0f61\u0f7c\u0f51\u0f0b\u0f58\u0f7a\u0f51\u0f0b\u0f56\u0f45\u0f66\u0f0b\u0f63\u0f0b\u0f5e\u0f72\u0f56\u0f0b\u0f56\u0f64\u0f7a\u0f62\u0f0b\u0f56\u0fb1\u0f0b\u0f62\u0f7c\u0f42\u0f66\u0f0d",
