    "Press the UP arrow key to enter the language menu then use UP and DOWN arrow keys to navigate language options. Press ENTER to change to the selected language.": "\u0f66\u0f90\u0f51\u0f0b\u0f61\u0f72\u0f42\u0f0b\u0f42\u0f72\u0f0b\u0f50\u0f7c\u0f0b\u0f42\u0f5e\u0f74\u0f44\u0f0b\u0f53\u0f44\u0f0b\u0f60\u0f5b\u0f74\u0f63\u0f0b\u0f56\u0f62\u0f0b UP \u0f63\u0f0b\u0f66\u0fa3\u0f74\u0f53\u0f0d \u0f51\u0f7a\u0f0b\u0f53\u0f66\u0f0b UP \u0f51\u0f44\u0f0b DOWN \u0f42\u0f49\u0f72\u0f66\u0f0b\u0f56\u0f40\u0f7c\u0f63\u0f0b\u0f4f\u0f7a\u0f0b\u0f66\u0f90\u0f51\u0f0b\u0f61\u0f72\u0f42\u0f0b\u0f60\u0f51\u0f7a\u0f58\u0f0b\u0f42\u0f66\u0f7a\u0f66\u0f0b\u0f56\u0fb1\u0f7c\u0f66\u0f0d \u0f56\u0f51\u0f58\u0f66\u0f0b\u0f5f\u0f72\u0f53\u0f0b\u0f54\u0f60\u0f72\u0f0b\u0f66\u0f90\u0f51\u0f0b\u0f61\u0f72\u0f42\u0f0b\u0f51\u0f7a\u0f0b\u0f63\u0f0b\u0f56\u0f66\u0f92\u0fb1\u0f74\u0f62\u0f0b\u0f56\u0f62\u0f0bENTER \u0f63\u0f0b\u0f66\u0fa3\u0f74\u0f53\u0f0d",
