    "Start regenerating certificates for students in this course?": "\u0f66\u0fb3\u0f7c\u0f56\u0f0b\u0f5a\u0f53\u0f0b\u0f60\u0f51\u0f72\u0f60\u0f72\u0f0b\u0f66\u0fb3\u0f7c\u0f56\u0f0b\u0f58\u0f0b\u0f61\u0f7c\u0f44\u0f66\u0f0b\u0f63\u0f0b\u0f63\u0f42\u0f0b\u0f41\u0fb1\u0f7a\u0f62\u0f0b\u0f56\u0f5f\u0f7c\u0f0b\u0f60\u0f42\u0f7c\u0f0b\u0f56\u0f62\u0fa9\u0f58\u0f66\u0f0b\u0f61\u0f7c\u0f51\u0f0d",
    "Start search": "\u0f60\u0f5a\u0f7c\u0f63\u0f0b\u0f60\u0f42\u0f7c\u0f0b\u0f62\u0fa9\u0f7c\u0f58\u0f66\u0f0d",
    "Started entrance exam rescore task for student '{student_id}'. Click the 'Show Task Status' button to see the status of the task.": "'{student_id}' \u0f66\u0fb3\u0f7c\u0f56\u0f0b\u0f55\u0fb2\u0f74\u0f42\u0f0b\u0f42\u0f72\u0f0b\u0f5a\u0f74\u0f51\u0f0b\u0f62\u0f92\u0fb1\u0f74\u0f42\u0f66\u0f0b\u0f56\u0f62\u0f92\u0fb1\u0f0b\u0f46\u0f0b\u0f56\u0f66\u0f90\u0fb1\u0f62\u0f0b\u0f66\u0f90\u0f7c\u0f62\u0f0b\u0f42\u0fb1\u0f72\u0f0b\u0f63\u0f66\u0f0b\u0f51\u0f7c\u0f53\u0f0b\u0f60\u0f42\u0f7c\u0f0b\u0f56\u0f62\u0fa9\u0f58\u0f66\u0f0b\u0f66\u0f7c\u0f44\u0f0b\u0f0d \u0f63\u0f66\u0f0b\u0f51\u0f7c\u0f53\u0f0b\u0f42\u0fb1\u0f72\u0f0b\u0f42\u0f53\u0f66\u0f0b\u0f56\u0f56\u0f0b\u0f63\u0f0b\u0f56\u0f63\u0f9f\u0f0b\u0f56\u0f62\u0f0b 'Show Task Status' \u0f42\u0f53\u0f7c\u0f53\u0f0b\u0f50\u0f7a\u0f56\u0f66\u0f0b\u0f60\u0f51\u0f72\u0f60\u0f72\u0f0b\u0f66\u0f92\u0f44\u0f0b\u0f63\u0f0b\u0f66\u0fa3\u0f74\u0f53\u0f0d",
    "Started rescore problem task for problem '<%- problem_id %>' and student '<%- student_id %>'. Click the 'Show Task Status' button to see the status of the task.": "\u0f51\u0fb2\u0f72\u0f0b\u0f56\u0f0b '<%- problem_id %>' \u0f62\u0fa3\u0f58\u0f66\u0f0b\u0f51\u0f44\u0f0b\u0f66\u0fb3\u0f7c\u0f56\u0f0b\u0f55\u0fb2\u0f74\u0f42\u0f0b '<%- student_id %>'. \u0f42\u0f72\u0f0b\u0f56\u0f62\u0f92\u0fb1\u0f0b\u0f46\u0f0b\u0f56\u0f66\u0f90\u0fb1\u0f62\u0f0b\u0f66\u0f90\u0f7c\u0f62\u0f0b\u0f42\u0fb1\u0f72\u0f0b\u0f63\u0f66\u0f0b\u0f51\u0f7c\u0f53\u0f0b\u0f60\u0f42\u0f7c\u0f0b\u0f56\u0f62\u0fa9\u0f58\u0f66\u0f0b\u0f66\u0f7c\u0f44\u0f0b\u0f0d \u0f63\u0f66\u0f0b\u0f51\u0f7c\u0f53\u0f0b\u0f42\u0fb1\u0f72\u0f0b\u0f42\u0f53\u0f66\u0f0b\u0f56\u0f56\u0f0b\u0f63\u0f0b\u0f56\u0f63\u0f9f\u0f0b\u0f56\u0f62\u0f0b 'Show Task Status' \u0f42\u0f53\u0f7c\u0f53\u0f0b\u0f50\u0f7a\u0f56\u0f66\u0f0b\u0f60\u0f51\u0f72\u0f60\u0f72\u0f0b\u0f66\u0f92\u0f44\u0f0b\u0f63\u0f0b\u0f66\u0fa3\u0f74\u0f53\u0f0d",
    "Started task to override the score for problem '<%- problem_id %>' and student '<%- student_id %>'. Click the 'Show Task Status' button to see the status of the task.": "Started task to override the score for problem '<%- problem_id %>' and student '<%- student_id %>'. Click the 'Show Task Status' button to see the status of the task.",
