    "Student username/email field is required and can not be empty. Kindly fill in username/email and then press \"Add to Exception List\" button.": "\u0f66\u0fb3\u0f7c\u0f56\u0f0b\u0f58\u0f60\u0f72\u0f0b\u0f66\u0fa4\u0fb1\u0f7c\u0f51\u0f0b\u0f58\u0f72\u0f44\u0f0b/\u0f42\u0fb3\u0f7c\u0f42\u0f0b\u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f42\u0fb1\u0f72\u0f0b\u0f66\u0f92\u0f58\u0f0b\u0f51\u0f7a\u0f0b\u0f44\u0f7a\u0f66\u0f0b\u0f54\u0f62\u0f0b\u0f51\u0f42\u0f7c\u0f66\u0f0b\u0f54\u0f66\u0f0b\u0f66\u0f9f\u0f7c\u0f44\u0f0b\u0f56\u0f62\u0f0b\u0f60\u0f47\u0f7c\u0f42\u0f0b\u0f58\u0f72\u0f0b\u0f49\u0f53\u0f0d \u0f66\u0fa4\u0fb1\u0f7c\u0f51\u0f0b\u0f58\u0f72\u0f44\u0f0b/\u0f42\u0fb3\u0f7c\u0f42\u0f0b\u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f42\u0f49\u0f72\u0f66\u0f0b\u0f5a\u0f74\u0f63\u0f0b\u0f58\u0f50\u0f74\u0f53\u0f0b\u0f42\u0fb1\u0f72\u0f66\u0f0b\u0f56\u0f66\u0f90\u0f44\u0f66\u0f0b\u0f4f\u0f7a\u0f0d \"\u0f51\u0f58\u0f72\u0f42\u0f66\u0f0b\u0f56\u0f66\u0f63\u0f0b\u0f50\u0f7c\u0f0b\u0f42\u0f5e\u0f74\u0f44\u0f0b\u0f63\u0f0b\u0f5e\u0f7c\u0f42\u0f0b\" \u0f5f\u0f7a\u0f62\u0f0b\u0f56\u0f60\u0f72\u0f0b\u0f58\u0f50\u0f7a\u0f56\u0f0b\u0f63\u0f0b\u0f66\u0fa3\u0f74\u0f53\u0f0d",
    "Student username/email field is required and can not be empty. Kindly fill in username/email and then press \"Invalidate Certificate\" button.": "\u0f66\u0fb3\u0f7c\u0f56\u0f0b\u0f58\u0f60\u0f72\u0f0b\u0f66\u0fa4\u0fb1\u0f7c\u0f51\u0f0b\u0f58\u0f72\u0f44\u0f0b/\u0f42\u0fb3\u0f7c\u0f42\u0f0b\u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f42\u0fb1\u0f72\u0f0b\u0f66\u0f92\u0f58\u0f0b\u0f51\u0f7a\u0f0b\u0f44\u0f7a\u0f66\u0f0b\u0f54\u0f62\u0f0b\u0f51\u0f42\u0f7c\u0f66\u0f0b\u0f54\u0f66\u0f0b\u0f66\u0f9f\u0f7c\u0f44\u0f0b\u0f56\u0f62\u0f0b\u0f60\u0f47\u0f7c\u0f42\u0f0b\u0f58\u0f72\u0f0b\u0f49\u0f53\u0f0d \u0f66\u0fa4\u0fb1\u0f7c\u0f51\u0f0b\u0f58\u0f72\u0f44\u0f0b/\u0f42\u0fb3\u0f7c\u0f42\u0f0b\u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f42\u0f49\u0f72\u0f66\u0f0b\u0f5a\u0f74\u0f63\u0f0b\u0f58\u0f50\u0f74\u0f53\u0f0b\u0f42\u0fb1\u0f72\u0f66\u0f0b\u0f56\u0f66\u0f90\u0f44\u0f66\u0f0b\u0f4f\u0f7a\u0f0d \"\u0f5a\u0f74\u0f63\u0f0b\u0f58\u0f50\u0f74\u0f53\u0f0b\u0f58\u0f72\u0f53\u0f0b\u0f54\u0f60\u0f72\u0f0b\u0f63\u0f42\u0f0b\u0f41\u0fb1\u0f7a\u0f62\u0f0b\" \u0f5f\u0f7a\u0f62\u0f0b\u0f56\u0f60\u0f72\u0f0b\u0f58\u0f50\u0f7a\u0f56\u0f0b\u0f63\u0f0b\u0f66\u0fa3\u0f74\u0f53\u0f0d",
