    "The language used throughout this site. This site is currently available in a limited number of languages. Changing the value of this field will cause the page to refresh.": "\u0f51\u0fb2\u0f0b\u0f42\u0f53\u0f66\u0f0b\u0f60\u0f51\u0f72\u0f60\u0f72\u0f0b\u0f66\u0fa4\u0fb1\u0f72\u0f0b\u0f61\u0f7c\u0f44\u0f66\u0f0b\u0f63\u0f0b\u0f56\u0f40\u0f7c\u0f63\u0f0b\u0f56\u0f60\u0f72\u0f0b\u0f66\u0f90\u0f51\u0f0b\u0f61\u0f72\u0f42\u0f0b\u0f51\u0f7a\u0f0d \u0f51\u0f0b\u0f66\u0f90\u0f56\u0f66\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f51\u0fb2\u0f0b\u0f42\u0f53\u0f66\u0f0b\u0f60\u0f51\u0f72\u0f60\u0f72\u0f0b\u0f53\u0f44\u0f0b\u0f66\u0f90\u0f51\u0f0b\u0f61\u0f72\u0f42\u0f0b\u0f49\u0f74\u0f44\u0f0b\u0f64\u0f66\u0f0b\u0f64\u0f72\u0f42\u0f0b\u0f63\u0f66\u0f0b\u0f58\u0f72\u0f0b\u0f60\u0f51\u0f74\u0f42 \u0f66\u0fa1\u0f7a\u0f0b\u0f5a\u0f53\u0f0b\u0f60\u0f51\u0f72\u0f60\u0f72\u0f0b\u0f62\u0f72\u0f53\u0f0b\u0f50\u0f44\u0f0b\u0f51\u0f7a\u0f0b\u0f56\u0f62\u0f97\u0f7a\u0f0b\u0f56\u0f66\u0f92\u0fb1\u0f74\u0f62\u0f0b\u0f56\u0fb1\u0f66\u0f0b\u0f53\u0f0b\u0f64\u0f7c\u0f42\u0f0b\u0f44\u0f7c\u0f66\u0f0b\u0f51\u0f7a\u0f0b\u0f56\u0f66\u0f90\u0fb1\u0f62\u0f0b\u0f63\u0f7a\u0f53\u0f0b\u0f56\u0fb1\u0f7a\u0f51\u0f0b\u0f54\u0f60\u0f72\u0f0b\u0f62\u0f90\u0fb1\u0f7a\u0f53\u0f0b\u0f51\u0f74\u0f0b\u0f60\u0f42\u0fb1\u0f74\u0f62\u0f0b\u0f60\u0f42\u0fb2\u0f7c\u0f0d",
    "The name that identifies you on {platform_name}. You cannot change your username.": "{platform_name} \u0f60\u0f51\u0f72\u0f60\u0f72\u0f0b\u0f66\u0f92\u0f44\u0f0b\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f44\u0f7c\u0f66\u0f0b\u0f60\u0f5b\u0f72\u0f53\u0f0b\u0f56\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f58\u0f72\u0f44\u0f0b\u0f66\u0f9f\u0f7a\u0f0d \u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f66\u0f0b\u0f62\u0f44\u0f0b\u0f42\u0f72\u0f0b\u0f66\u0fa4\u0fb1\u0f7c\u0f51\u0f0b\u0f58\u0f72\u0f44\u0f0b\u0f56\u0f62\u0f97\u0f7a\u0f0b\u0f58\u0f72\u0f0b\u0f50\u0f74\u0f56\u0f0d",
    "The name that is used for ID verification and that appears on your certificates.": "\u0f58\u0f72\u0f44\u0f0b\u0f60\u0f51\u0f72\u0f0b\u0f53\u0f72\u0f0b\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b ID \u0f61\u0f72\u0f0b\u0f41\u0f74\u0f44\u0f66\u0f0b\u0f66\u0f90\u0fb1\u0f7a\u0f63\u0f0b\u0f63\u0f0b\u0f56\u0f40\u0f7c\u0f63\u0f0b\u0f62\u0f92\u0fb1\u0f74\u0f0b\u0f58\u0f0b\u0f5f\u0f51\u0f0b\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f63\u0f42\u0f0b\u0f41\u0fb1\u0f7a\u0f62\u0f0b\u0f42\u0fb1\u0f72\u0f0b\u0f66\u0f9f\u0f7a\u0f44\u0f0b\u0f63\u0f0b\u0f61\u0f44\u0f0b\u0f60\u0f42\u0f7c\u0f51\u0f0b\u0f62\u0f92\u0fb1\u0f74\u0f0b\u0f61\u0f72\u0f53\u0f0d",
    "The page \"{route}\" could not be found.": "\"{route}\" \u0f64\u0f7c\u0f42\u0f0b\u0f44\u0f7c\u0f66\u0f0b\u0f62\u0f99\u0f7a\u0f51\u0f0b\u0f58\u0f72\u0f0b\u0f50\u0f74\u0f56\u0f0d",
    "The post you selected has been deleted.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f66\u0f0b\u0f56\u0f51\u0f58\u0f66\u0f0b\u0f54\u0f60\u0f72\u0f0b\u0f62\u0fa9\u0f7c\u0f58\u0f0b\u0f61\u0f72\u0f42\u0f0b\u0f56\u0f66\u0f74\u0f56\u0f0b\u0f5a\u0f62\u0f0b\u0f60\u0f51\u0f74\u0f42",
    "The refund deadline for this course has passed, so you will not receive a refund.": "\u0f66\u0fb3\u0f7c\u0f56\u0f0b\u0f5a\u0f53\u0f0b\u0f60\u0f51\u0f72\u0f60\u0f72\u0f0b\u0f42\u0fb3\u0f0b\u0f46\u0f0b\u0f55\u0fb1\u0f72\u0f62\u0f0b\u0f66\u0fb3\u0f7c\u0f42\u0f0b\u0f54\u0f60\u0f72\u0f0b\u0f51\u0f74\u0f66\u0f0b\u0f56\u0f45\u0f51\u0f0b\u0f63\u0f66\u0f0b\u0f56\u0f62\u0f92\u0f63\u0f0b\u0f5f\u0f72\u0f53\u0f0b\u0f54\u0f66\u0f0b\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f63\u0f0b\u0f66\u0f92\u0f7c\u0f62\u0f0b\u0f58\u0f7c\u0f0b\u0f55\u0fb1\u0f72\u0f62\u0f0b\u0f66\u0fb3\u0f7c\u0f42\u0f0b\u0f58\u0f72\u0f0b\u0f66\u0fb2\u0f72\u0f51\u0f0d",
    "The selected content group does not exist": "\u0f56\u0f51\u0f58\u0f66\u0f0b\u0f5f\u0f72\u0f53\u0f0b\u0f54\u0f60\u0f72\u0f0b\u0f53\u0f44\u0f0b\u0f51\u0f7c\u0f53\u0f0b\u0f42\u0fb1\u0f72\u0f0b\u0f5a\u0f7c\u0f42\u0f66\u0f0b\u0f51\u0f7a\u0f0b\u0f58\u0f72\u0f0b\u0f60\u0f51\u0f74\u0f42",
    "The team \"{team}\" could not be found.": "\"{team}\" \u0f5a\u0f7c\u0f42\u0f66\u0f0b\u0f46\u0f74\u0f44\u0f0b\u0f62\u0f99\u0f7a\u0f51\u0f0b\u0f58\u0f72\u0f0b\u0f50\u0f74\u0f56\u0f0d",
    "The topic \"{topic}\" could not be found.": "\"{topic}\" \u0f56\u0f62\u0f97\u0f7c\u0f51\u0f0b\u0f42\u0f5e\u0f72\u0f0b\u0f62\u0f99\u0f7a\u0f51\u0f0b\u0f58\u0f72\u0f0b\u0f50\u0f74\u0f56\u0f0d",
    "The {cohortGroupName} cohort has been created. You can manually add students to this cohort below.": "{cohortGroupName} \u0f62\u0f72\u0f42\u0f66\u0f0b\u0f51\u0f56\u0fb1\u0f7a\u0f60\u0f72\u0f0b\u0f5a\u0f7c\u0f42\u0f66\u0f0b\u0f46\u0f74\u0f44\u0f0b\u0f56\u0f5f\u0f7c\u0f66\u0f0b\u0f61\u0f7c\u0f51\u0f0d \u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f66\u0f0b\u0f66\u0fb3\u0f7c\u0f56\u0f0b\u0f55\u0fb2\u0f74\u0f42\u0f0b\u0f62\u0f7a\u0f0b\u0f62\u0f7a\u0f0b\u0f56\u0fb1\u0f66\u0f0b\u0f4f\u0f7a\u0f0b\u0f42\u0f64\u0f58\u0f0b\u0f42\u0fb1\u0f72\u0f0b\u0f62\u0f72\u0f42\u0f66\u0f0b\u0f51\u0f56\u0fb1\u0f7a\u0f60\u0f72\u0f0b\u0f53\u0f44\u0f0b\u0f66\u0fa3\u0f7c\u0f53\u0f0d",
    "There are invalid keywords in your email. Check the following keywords and try again.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f42\u0fb3\u0f7c\u0f42\u0f0b\u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f53\u0f44\u0f0b\u0f5a\u0f74\u0f63\u0f0b\u0f58\u0f50\u0f74\u0f53\u0f0b\u0f58\u0f72\u0f53\u0f0b\u0f54\u0f60\u0f72\u0f0b\u0f5a\u0f72\u0f42\u0f0b\u0f42\u0f53\u0f51\u0f0b\u0f45\u0f72\u0f42\u0f0b\u0f60\u0f51\u0f74\u0f42 \u0f42\u0f64\u0f58\u0f0b\u0f56\u0f40\u0f7c\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f5a\u0f72\u0f42\u0f0b\u0f42\u0f53\u0f51\u0f0b\u0f62\u0fa3\u0f58\u0f66\u0f0b\u0f63\u0f0b\u0f5e\u0f72\u0f56\u0f0b\u0f56\u0f64\u0f7a\u0f62\u0f0b\u0f56\u0fb1\u0f66\u0f0b\u0f4f\u0f7a\u0f0b\u0f56\u0f66\u0f90\u0fb1\u0f62\u0f0b\u0f51\u0f74\u0f0b\u0f5a\u0f7c\u0f51\u0f0b\u0f63\u0f9f\u0f0b\u0f56\u0fb1\u0f7c\u0f66\u0f0d",
    "There are no posts in this topic yet.": "\u0f56\u0f62\u0f97\u0f7c\u0f51\u0f0b\u0f42\u0f5e\u0f72\u0f0b\u0f60\u0f51\u0f72\u0f60\u0f72\u0f0b\u0f53\u0f44\u0f0b\u0f51\u0f0b\u0f51\u0f74\u0f44\u0f0b\u0f62\u0fa9\u0f7c\u0f58\u0f0b\u0f61\u0f72\u0f42\u0f0b\u0f58\u0f72\u0f0b\u0f60\u0f51\u0f74\u0f42",
    "There has been an error processing your survey.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f56\u0f62\u0f9f\u0f42\u0f0b\u0f51\u0f54\u0fb1\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f56\u0f62\u0f92\u0fb1\u0f74\u0f51\u0f0b\u0f62\u0f72\u0f58\u0f0b\u0f63\u0f0b\u0f42\u0f53\u0f51\u0f0b\u0f51\u0f7c\u0f53\u0f0b\u0f5e\u0f72\u0f42\u0f0b\u0f56\u0fb1\u0f74\u0f44\u0f0b\u0f66\u0f7c\u0f44\u0f0b\u0f0d",
    "There is no email history for this course.": "\u0f66\u0fb3\u0f7c\u0f56\u0f0b\u0f5a\u0f53\u0f0b\u0f60\u0f51\u0f72\u0f60\u0f72\u0f0b\u0f42\u0fb3\u0f7c\u0f42\u0f0b\u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f63\u0f7c\u0f0b\u0f62\u0f92\u0fb1\u0f74\u0f66\u0f0b\u0f64\u0f72\u0f42\u0f0b\u0f58\u0f72\u0f0b\u0f60\u0f51\u0f74\u0f42",
    "There must be one cohort to which students can automatically be assigned.": "\u0f66\u0fb3\u0f7c\u0f56\u0f0b\u0f55\u0fb2\u0f74\u0f42\u0f0b\u0f5a\u0f7c\u0f62\u0f0b\u0f62\u0f44\u0f0b\u0f60\u0f42\u0f74\u0f63\u0f0b\u0f42\u0fb1\u0f72\u0f66\u0f0b\u0f60\u0f42\u0f53\u0f0b\u0f56\u0f66\u0f90\u0f74\u0f63\u0f0b\u0f50\u0f74\u0f56\u0f0b\u0f54\u0f60\u0f72\u0f0b\u0f5a\u0f7c\u0f42\u0f66\u0f0b\u0f41\u0f42\u0f0b\u0f42\u0f45\u0f72\u0f42\u0f0b\u0f61\u0f72\u0f53\u0f0b\u0f51\u0f42\u0f7c\u0f66\u0f0d",
    "There was a problem creating the report. Select \"Create Executive Summary\" to try again.": "\u0f66\u0f99\u0f53\u0f0b\u0f5e\u0f74\u0f0b\u0f56\u0f5f\u0f7c\u0f0b\u0f56\u0f62\u0f0b\u0f51\u0f40\u0f60\u0f0b\u0f44\u0f63\u0f0b\u0f5e\u0f72\u0f42\u0f0b\u0f60\u0f51\u0f74\u0f42 \u0f56\u0f66\u0f90\u0fb1\u0f62\u0f0b\u0f51\u0f74\u0f0b\u0f5a\u0f7c\u0f51\u0f0b\u0f63\u0f9f\u0f0b\u0f56\u0fb1\u0f7a\u0f51\u0f0b\u0f54\u0f62\u0f0b \"Create Executive Summary\" \u0f60\u0f51\u0f72\u0f0b\u0f60\u0f51\u0f7a\u0f58\u0f0d",
    "There was an error generating the report link.": "\u0f66\u0f99\u0f53\u0f0b\u0f5e\u0f74\u0f60\u0f72\u0f0b\u0f51\u0fb2\u0f0b\u0f50\u0f42\u0f0b\u0f56\u0f5f\u0f7c\u0f0b\u0f56\u0f62\u0f0b\u0f42\u0f53\u0f51\u0f0b\u0f51\u0f7c\u0f53\u0f0b\u0f5e\u0f72\u0f42\u0f0b\u0f56\u0fb1\u0f74\u0f44\u0f0b\u0f66\u0f7c\u0f44\u0f0b\u0f0d",
