    "We couldn't sign you in.": "\u0f44\u0f0b\u0f5a\u0f7c\u0f66\u0f0b\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f53\u0f44\u0f0b\u0f60\u0f5b\u0f74\u0f63\u0f0b\u0f56\u0fb1\u0f0b\u0f50\u0f74\u0f56\u0f0b\u0f58\u0f0b\u0f66\u0f7c\u0f44\u0f0b\u0f0d",
    "We have encountered an error. Refresh your browser and then try again.": "\u0f44\u0f0b\u0f5a\u0f7c\u0f62\u0f0b\u0f42\u0f53\u0f51\u0f0b\u0f51\u0f7c\u0f53\u0f0b\u0f5e\u0f72\u0f42\u0f0b\u0f56\u0fb1\u0f74\u0f44\u0f0b\u0f66\u0f7c\u0f44\u0f0b\u0f0d \u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f56\u0f63\u0f9f\u0f0b\u0f46\u0f66\u0f0b\u0f56\u0f66\u0f90\u0fb1\u0f62\u0f0b\u0f63\u0f7a\u0f53\u0f0b\u0f56\u0fb1\u0f66\u0f0b\u0f53\u0f66\u0f0b\u0f56\u0f66\u0f90\u0fb1\u0f62\u0f0b\u0f51\u0f74\u0f0b\u0f5a\u0f7c\u0f51\u0f0b\u0f63\u0f9f\u0f0b\u0f56\u0fb1\u0f7c\u0f66\u0f0d",
    "We just need a little more information before you start learning with %(platformName)s.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f66\u0f0b%(platformName)s \u0f60\u0f51\u0f72\u0f0b\u0f66\u0fb3\u0f7c\u0f56\u0f0b\u0f60\u0f42\u0f7c\u0f0b\u0f58\u0f0b\u0f56\u0f62\u0fa9\u0f58\u0f0b\u0f42\u0f7c\u0f44\u0f0b\u0f44\u0f0b\u0f5a\u0f7c\u0f62\u0f0b\u0f42\u0f53\u0f66\u0f0b\u0f5a\u0f74\u0f63\u0f0b\u0f58\u0f44\u0f0b\u0f59\u0f58\u0f0b\u0f51\u0f42\u0f7c\u0f66\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f60\u0f51\u0f74\u0f42",
    "We're sorry to see you go! Your account will be deleted shortly.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f50\u0f7c\u0f53\u0f0b\u0f60\u0f42\u0fb2\u0f7c\u0f0b\u0f56\u0f0b\u0f58\u0f50\u0f7c\u0f44\u0f0b\u0f56\u0f66\u0f0b\u0f44\u0f0b\u0f5a\u0f7c\u0f60\u0f72\u0f0b\u0f66\u0f7a\u0f58\u0f66\u0f0b\u0f54\u0f0b\u0f66\u0f90\u0fb1\u0f7c\u0f0d \u0f58\u0f72\u0f0b\u0f62\u0f72\u0f44\u0f0b\u0f56\u0f62\u0f0b\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f41\u0f0b\u0f56\u0fb1\u0f44\u0f0b\u0f56\u0f66\u0f74\u0f56\u0f0b\u0f62\u0f92\u0fb1\u0f74\u0f0b\u0f61\u0f72\u0f53\u0f0d",
