    "We've sent a confirmation message to {new_email_address}. Click the link in the message to update your email address.": "\u0f44\u0f0b\u0f5a\u0f7c\u0f66\u0f0b\u0f60\u0f51\u0f72\u0f62\u0f0b {new_email_address} \u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f63\u0f0b\u0f42\u0f4f\u0f53\u0f0b\u0f60\u0f41\u0f7a\u0f63\u0f0b\u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f50\u0f74\u0f44\u0f0b\u0f5e\u0f72\u0f42\u0f0b\u0f56\u0f4f\u0f44\u0f0b\u0f61\u0f7c\u0f51\u0f0d \u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f50\u0f74\u0f44\u0f0b\u0f53\u0f44\u0f0b\u0f42\u0f72\u0f0b\u0f51\u0fb2\u0f0b\u0f50\u0f42\u0f0b\u0f51\u0f7a\u0f60\u0f72\u0f0b\u0f66\u0f9f\u0f7a\u0f44\u0f0b\u0f56\u0f66\u0fa3\u0f74\u0f53\u0f0b\u0f4f\u0f7a\u0f0b\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f42\u0fb3\u0f7c\u0f42\u0f0b\u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f53\u0f44\u0f0b\u0f60\u0f47\u0f74\u0f42\u0f0b\u0f56\u0fb1\u0f7c\u0f66\u0f0d",
    "We've sent a confirmation message to {new_secondary_email_address}. Click the link in the message to update your secondary email address.": "\u0f44\u0f0b\u0f5a\u0f7c\u0f66\u0f0b\u0f60\u0f51\u0f72\u0f62\u0f0b {new_secondary_email_address} \u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f63\u0f0b\u0f42\u0f4f\u0f53\u0f0b\u0f60\u0f41\u0f7a\u0f63\u0f0b\u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f50\u0f74\u0f44\u0f0b\u0f5e\u0f72\u0f42\u0f0b\u0f56\u0f4f\u0f44\u0f0b\u0f61\u0f7c\u0f51\u0f0d \u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f50\u0f74\u0f44\u0f0b\u0f53\u0f44\u0f0b\u0f42\u0f72\u0f0b\u0f51\u0fb2\u0f0b\u0f50\u0f42\u0f0b\u0f51\u0f7a\u0f60\u0f72\u0f0b\u0f66\u0f9f\u0f7a\u0f44\u0f0b\u0f56\u0f66\u0fa3\u0f74\u0f53\u0f0b\u0f4f\u0f7a\u0f0b\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f42\u0fb3\u0f7c\u0f42\u0f0b\u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f42\u0f5e\u0f53\u0f0b\u0f54\u0f0b\u0f51\u0f7a\u0f0b\u0f5e\u0f7c\u0f42",
    "We've sent a message to {email}. Click the link in the message to reset your password. Didn't receive the message? Contact {anchorStart}technical support{anchorEnd}.": "\u0f44\u0f0b\u0f5a\u0f7c\u0f66\u0f0b\u0f60\u0f51\u0f72\u0f62\u0f0b {email} \u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f63\u0f0b\u0f42\u0f4f\u0f53\u0f0b\u0f60\u0f41\u0f7a\u0f63\u0f0b\u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f50\u0f74\u0f44\u0f0b\u0f5e\u0f72\u0f42\u0f0b\u0f56\u0f4f\u0f44\u0f0b\u0f61\u0f7c\u0f51\u0f0d \u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f42\u0f66\u0f44\u0f0b\u0f42\u0fb2\u0f44\u0f66\u0f0b\u0f56\u0f66\u0f90\u0fb1\u0f62\u0f0b\u0f66\u0f92\u0fb2\u0f72\u0f42\u0f0b\u0f56\u0fb1\u0f7a\u0f51\u0f0b\u0f54\u0f62\u0f0b\u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f50\u0f74\u0f44\u0f0b\u0f53\u0f44\u0f0b\u0f42\u0f72\u0f0b\u0f51\u0fb2\u0f0b\u0f50\u0f42\u0f0b\u0f51\u0f7a\u0f60\u0f72\u0f0b\u0f66\u0f9f\u0f7a\u0f44\u0f0b\u0f66\u0fa3\u0f74\u0f53\u0f0d \u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f50\u0f74\u0f44\u0f0b\u0f51\u0f7a\u0f0b\u0f60\u0f56\u0fb1\u0f7c\u0f62\u0f0b\u0f58\u0f0b\u0f66\u0f7c\u0f44\u0f0b\u0f44\u0f58\u0f0d \u0f50\u0f56\u0f66\u0f0b\u0f63\u0f58\u0f0b\u0f66\u0fb3\u0f7c\u0f56\u0f0b\u0f66\u0f9f\u0f7c\u0f53\u0f0b\u0f54\u0f62\u0f0b {anchorStart}\u0f60\u0f56\u0fb2\u0f7a\u0f63\u0f0b\u0f56\u0f0b\u0f56\u0fb1\u0f7c\u0f66\u0f0d{anchorEnd}",
    "We\u2019re sorry to see you go!": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f50\u0f7c\u0f53\u0f0b\u0f60\u0f42\u0fb2\u0f7c\u0f0b\u0f56\u0f0b\u0f58\u0f50\u0f7c\u0f44\u0f0b\u0f56\u0f66\u0f0b\u0f44\u0f0b\u0f5a\u0f7c\u0f60\u0f72\u0f0b\u0f66\u0f7a\u0f58\u0f66\u0f0b\u0f54\u0f0b\u0f66\u0f90\u0fb1\u0f7c\u0f0d",
