    "What was the total combined income, during the last 12 months, of all members of your family? ": "\u0f49\u0f7a\u0f0b\u0f63\u0f58\u0f0b\u0f5f\u0fb3\u0f0b\u0f56\u0f0b\u0f56\u0f45\u0f74\u0f0b\u0f42\u0f49\u0f72\u0f66\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f62\u0f72\u0f44\u0f0b\u0f63\u0f0b\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f5a\u0f7c\u0f60\u0f72\u0f0b\u0f41\u0fb1\u0f72\u0f58\u0f0b\u0f58\u0f72\u0f0b\u0f61\u0f7c\u0f44\u0f66\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f61\u0f7c\u0f44\u0f0b\u0f60\u0f56\u0f56\u0f0b\u0f56\u0f66\u0fa1\u0f7c\u0f58\u0f66\u0f0b\u0f60\u0f56\u0f7c\u0f62\u0f0b\u0f42\u0f0b\u0f5a\u0f7c\u0f51\u0f0b\u0f61\u0f7c\u0f51\u0f0b\u0f51\u0f58\u0f0d ",
    "What's in my clipboard?": "\u0f44\u0f60\u0f72\u0f0b\u0f66\u0fa6\u0fb1\u0f62\u0f0b\u0f54\u0f44\u0f0b\u0f53\u0f44\u0f0b\u0f45\u0f72\u0f0b\u0f5e\u0f72\u0f42\u0f0b\u0f60\u0f51\u0f74\u0f42",
    "While our support team is happy to assist with the edX platform, the course staff has the expertise for specific assignment questions, grading or the proper procedures in each course. Please post all course related questions within the Discussion Forum where the Course Staff can directly respond.": "While our support team is happy to assist with the edX platform, the course staff has the expertise for specific assignment questions, grading or the proper procedures in each course. Please post all course related questions within the Discussion Forum where the Course Staff can directly respond.",
