    "You already belong to another team in this team set.": "\u0f5a\u0f7c\u0f42\u0f66\u0f0b\u0f46\u0f74\u0f44\u0f0b\u0f60\u0f51\u0f72\u0f60\u0f72\u0f0b\u0f66\u0fa1\u0f7a\u0f0b\u0f5a\u0f53\u0f0b\u0f53\u0f44\u0f0b\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f62\u0f44\u0f0b\u0f5a\u0f7c\u0f42\u0f66\u0f0b\u0f46\u0f74\u0f44\u0f0b\u0f42\u0f5e\u0f53\u0f0b\u0f5e\u0f72\u0f42\u0f0b\u0f63\u0f0b\u0f51\u0f56\u0f44\u0f0b\u0f60\u0f51\u0f74\u0f42",
