    "You are sending an email message with the subject {subject} to the following recipients.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f66\u0f0b\u0f56\u0f66\u0f92\u0fb2\u0f74\u0f56\u0f0b\u0f56\u0fb1\u0f0b{subject} \u0f60\u0f51\u0f72\u0f0b\u0f51\u0f44\u0f0b\u0f60\u0f56\u0fb2\u0f7a\u0f63\u0f0b\u0f56\u0f60\u0f72\u0f0b\u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f50\u0f74\u0f44\u0f0b\u0f5e\u0f72\u0f42\u0f0b\u0f42\u0f64\u0f58\u0f0b\u0f42\u0f66\u0f63\u0f0b\u0f42\u0fb1\u0f72\u0f0b\u0f56\u0f66\u0f90\u0f74\u0f62\u0f0b\u0f61\u0f74\u0f63\u0f0b\u0f62\u0fa3\u0f58\u0f66\u0f0b\u0f63\u0f0b\u0f66\u0f90\u0f74\u0f62\u0f0b\u0f56\u0f5e\u0f72\u0f53\u0f0b\u0f60\u0f51\u0f74\u0f42",
