    "You must select a session to access the course.": "\u0f66\u0fb3\u0f7c\u0f56\u0f0b\u0f5a\u0f53\u0f0b\u0f56\u0f66\u0f94\u0f7c\u0f42\u0f0b\u0f54\u0f62\u0f0b\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f66\u0f0b\u0f66\u0fa1\u0f7a\u0f0b\u0f5a\u0f53\u0f0b\u0f5e\u0f72\u0f42\u0f0b\u0f44\u0f7a\u0f66\u0f0b\u0f54\u0f62\u0f0b\u0f60\u0f51\u0f7a\u0f58\u0f0b\u0f51\u0f42\u0f7c\u0f66\u0f0d",
    "You must sign out and sign back in before your language changes take effect.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f66\u0f0b\u0f66\u0f90\u0f51\u0f0b\u0f61\u0f72\u0f42\u0f0b\u0f56\u0f62\u0f97\u0f7a\u0f0b\u0f56\u0f66\u0f92\u0fb1\u0f74\u0f62\u0f0b\u0f42\u0fb1\u0f72\u0f0b\u0f64\u0f74\u0f42\u0f66\u0f0b\u0f62\u0f90\u0fb1\u0f7a\u0f53\u0f0b\u0f58\u0f0b\u0f66\u0fb3\u0f7a\u0f56\u0f0b\u0f42\u0f7c\u0f44\u0f0b\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f44\u0f7a\u0f66\u0f0b\u0f54\u0f62\u0f0b\u0f55\u0fb1\u0f72\u0f62\u0f0b\u0f50\u0f7c\u0f53\u0f0b\u0f56\u0fb1\u0f66\u0f0b\u0f4f\u0f7a\u0f0b\u0f56\u0f66\u0f90\u0fb1\u0f62\u0f0b\u0f51\u0f74\u0f0b\u0f53\u0f44\u0f0b\u0f60\u0f5b\u0f74\u0f63\u0f0b\u0f56\u0fb1\u0f7c\u0f66\u0f0d",
    "You must specify a name for the cohort": "\u0f5a\u0f7c\u0f42\u0f66\u0f0b\u0f54\u0f0b\u0f51\u0f7a\u0f60\u0f72\u0f0b\u0f46\u0f7a\u0f51\u0f0b\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f66\u0f0b\u0f58\u0f72\u0f44\u0f0b\u0f5e\u0f72\u0f42\u0f0b\u0f42\u0f66\u0f63\u0f0b\u0f41\u0f0b\u0f44\u0f7a\u0f66\u0f0b\u0f54\u0f62\u0f0b\u0f60\u0f51\u0f7c\u0f53\u0f0b\u0f51\u0f42\u0f7c\u0f66\u0f0d",
    "You must specify your birth year before you can share your full profile. To specify your birth year, go to the {account_settings_page_link}": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f66\u0f0b\u0f42\u0f53\u0f66\u0f0b\u0f5a\u0f74\u0f63\u0f0b\u0f46\u0f0b\u0f5a\u0f44\u0f0b\u0f61\u0f7c\u0f44\u0f66\u0f0b\u0f42\u0fb2\u0f42\u0f66\u0f0b\u0f58\u0f0b\u0f56\u0fb1\u0f66\u0f0b\u0f66\u0f94\u0f7c\u0f53\u0f0b\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f66\u0f90\u0fb1\u0f7a\u0f66\u0f0b\u0f63\u0f7c\u0f0b\u0f44\u0f7a\u0f66\u0f0b\u0f54\u0f62\u0f0b\u0f51\u0f74\u0f0b\u0f42\u0f4f\u0f53\u0f0b\u0f60\u0f41\u0f7a\u0f63\u0f0b\u0f56\u0fb1\u0f0b\u0f51\u0f42\u0f7c\u0f66\u0f0d \u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f66\u0f90\u0fb1\u0f7a\u0f66\u0f0b\u0f63\u0f7c\u0f0b\u0f42\u0f4f\u0f53\u0f0b\u0f60\u0f41\u0f7a\u0f63\u0f0b\u0f56\u0fb1\u0f7a\u0f51\u0f0b\u0f54\u0f62\u0f0b {account_settings_page_link} \u0f60\u0f51\u0f72\u0f62\u0f0b\u0f55\u0f7a\u0f56\u0f66\u0f0d",
    "You receive messages from {platform_name} and course teams at this address.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f63\u0f0b\u0f42\u0fb3\u0f7c\u0f42\u0f0b\u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f60\u0f51\u0f72\u0f60\u0f72\u0f0b\u0f53\u0f44\u0f0b {platform_name} \u0f60\u0f51\u0f72\u0f0b\u0f51\u0f44\u0f0b\u0f66\u0fb3\u0f7c\u0f56\u0f0b\u0f5a\u0f53\u0f0b\u0f5a\u0f7c\u0f42\u0f66\u0f0b\u0f54\u0f0b\u0f42\u0f49\u0f72\u0f66\u0f0b\u0f40\u0fb1\u0f72\u0f66\u0f0b\u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f42\u0f4f\u0f7c\u0f44\u0f0b\u0f61\u0f7c\u0f44\u0f0b\u0f0d",
    "You submitted {filename}; only {allowedFiles} are allowed.": "You submitted {filename}; only {allowedFiles} are allowed.",
    "You will be refunded the amount you paid.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f66\u0f0b\u0f66\u0fa4\u0fb2\u0f51\u0f0b\u0f54\u0f60\u0f72\u0f0b\u0f51\u0f44\u0f74\u0f63\u0f0b\u0f42\u0fb2\u0f44\u0f66\u0f0b\u0f51\u0f7a\u0f0b\u0f55\u0fb1\u0f72\u0f62\u0f0b\u0f66\u0fb3\u0f7c\u0f56\u0f0b\u0f61\u0f7c\u0f51\u0f0d",
    "You will not be refunded the amount you paid.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f66\u0f0b\u0f66\u0fa4\u0fb2\u0f51\u0f0b\u0f54\u0f60\u0f72\u0f0b\u0f51\u0f44\u0f74\u0f63\u0f0b\u0f42\u0fb2\u0f44\u0f66\u0f0b\u0f51\u0f7a\u0f0b\u0f55\u0fb1\u0f72\u0f62\u0f0b\u0f66\u0fb3\u0f7c\u0f42\u0f0b\u0f58\u0f7a\u0f51\u0f0d",
    "You've made some changes": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f66\u0f0b\u0f60\u0f42\u0fb1\u0f74\u0f62\u0f0b\u0f56\u0f0b\u0f60\u0f42\u0f60\u0f0b\u0f62\u0f7a\u0f0b\u0f56\u0f4f\u0f44\u0f0b\u0f60\u0f51\u0f74\u0f42",
    "You've made some changes, but there are some errors": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f66\u0f0b\u0f60\u0f42\u0fb1\u0f74\u0f62\u0f0b\u0f56\u0f0b\u0f62\u0f7a\u0f0b\u0f5f\u0f74\u0f44\u0f0b\u0f56\u0f4f\u0f44\u0f0b\u0f60\u0f51\u0f74\u0f42\u0f0b\u0f58\u0f7c\u0f51\u0f0d \u0f51\u0f7a\u0f0b\u0f51\u0f42\u0f0b\u0f42\u0f72\u0f0b\u0f53\u0f44\u0f0b\u0f42\u0f53\u0f51\u0f0b\u0f51\u0f7c\u0f53\u0f0b\u0f60\u0f42\u0f60\u0f0b\u0f62\u0f7a\u0f0b\u0f64\u0f7c\u0f62\u0f0b\u0f60\u0f51\u0f74\u0f42",
    "You've successfully signed into %(currentProvider)s.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f56\u0f51\u0f7a\u0f0b\u0f63\u0f7a\u0f42\u0f66\u0f0b\u0f44\u0f44\u0f0b %(currentProvider)s \u0f60\u0f51\u0f72\u0f60\u0f72\u0f0b\u0f53\u0f44\u0f0b\u0f53\u0f44\u0f0b\u0f60\u0f5b\u0f74\u0f63\u0f0b\u0f56\u0fb1\u0f66\u0f0b\u0f61\u0f7c\u0f51\u0f0d",
    "Your browser doesn't support direct access to the clipboard. Please use the Ctrl+X/C/V keyboard shortcuts instead.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f56\u0f63\u0f9f\u0f0b\u0f56\u0f64\u0f7a\u0f62\u0f0b\u0f51\u0fb2\u0f0b\u0f44\u0f7c\u0f66\u0f0b\u0f60\u0f51\u0f72\u0f0b\u0f63\u0f0b\u0f50\u0f51\u0f0b\u0f40\u0f62\u0f0b clipboard \u0f63\u0f0b\u0f60\u0f42\u0fb2\u0f7c\u0f0b\u0f56\u0f60\u0f72\u0f0b\u0f58\u0f50\u0f74\u0f53\u0f0b\u0f62\u0f90\u0fb1\u0f7a\u0f53\u0f0b\u0f58\u0f72\u0f0b\u0f60\u0f51\u0f74\u0f42\u0f0b\u0f54\u0f66\u0f0d \u0f51\u0f7a\u0f60\u0f72\u0f0b\u0f5a\u0f56\u0f0b\u0f63\u0f0b\u0f58\u0fb1\u0f74\u0f62\u0f0b\u0f50\u0f7a\u0f56\u0f66\u0f0b Ctrl+X/C/V \u0f60\u0f51\u0f72\u0f0b\u0f51\u0f42\u0f0b\u0f56\u0f40\u0f7c\u0f63\u0f0b\u0f62\u0f7c\u0f42\u0f66\u0f0d",
