    "Your changes have been saved. {details}": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f56\u0f66\u0f92\u0fb1\u0f74\u0f62\u0f0b\u0f56\u0f45\u0f7c\u0f66\u0f0b\u0f62\u0fa3\u0f58\u0f66\u0f0b\u0f49\u0f62\u0f0b\u0f61\u0f7c\u0f51\u0f0d {details}",
