    "Your donation could not be submitted.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f5e\u0f63\u0f0b\u0f60\u0f51\u0f7a\u0f56\u0f66\u0f0b\u0f51\u0f7a\u0f0b\u0f42\u0f4f\u0f7c\u0f44\u0f0b\u0f50\u0f74\u0f56\u0f0b\u0f66\u0f0b\u0f58\u0f0b\u0f62\u0f7a\u0f51\u0f0d",
    "Your email message was successfully queued for sending. In courses with a large number of learners, email messages to learners might take up to an hour to be sent.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f50\u0f74\u0f44\u0f0b\u0f51\u0f7a\u0f0b\u0f62\u0f72\u0f58\u0f0b\u0f54\u0f66\u0f0b\u0f42\u0f4f\u0f7c\u0f44\u0f0b\u0f62\u0f92\u0fb1\u0f74\u0f60\u0f72\u0f0b\u0f56\u0f44\u0f0b\u0f62\u0f72\u0f58\u0f0b\u0f53\u0f44\u0f0b\u0f56\u0f51\u0f7a\u0f0b\u0f63\u0f7a\u0f42\u0f66\u0f0b\u0f44\u0f44\u0f0b\u0f56\u0f5e\u0f42\u0f0b\u0f61\u0f7c\u0f51\u0f0d\u0f60\u0f5b\u0f72\u0f53\u0f0b\u0f42\u0fb2\u0fad\u0f0b\u0f62\u0f7a\u0f0b\u0f62\u0f7a\u0f60\u0f72\u0f0b\u0f53\u0f44\u0f0b\u0f66\u0fb3\u0f7c\u0f56\u0f0b\u0f42\u0f49\u0f7a\u0f62\u0f0b\u0f56\u0f0b\u0f60\u0f56\u0f7c\u0f62\u0f0b\u0f46\u0f7a\u0f53\u0f0b\u0f62\u0f7a\u0f0b\u0f61\u0f7c\u0f51\u0f0b\u0f62\u0f7a\u0f51\u0f0d \u0f51\u0f7a\u0f60\u0f72\u0f0b\u0f55\u0fb1\u0f72\u0f62\u0f0b\u0f66\u0fb3\u0f7c\u0f56\u0f0b\u0f42\u0f49\u0f7a\u0f62\u0f0b\u0f56\u0f0b\u0f61\u0f7c\u0f44\u0f66\u0f0b\u0f63\u0f0b\u0f42\u0fb3\u0f7c\u0f42\u0f0b\u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f62\u0f7a\u0f0b\u0f62\u0f7a\u0f0b\u0f56\u0fb1\u0f66\u0f0b\u0f53\u0f66\u0f0b\u0f42\u0f4f\u0f7c\u0f44\u0f0b\u0f51\u0f42\u0f7c\u0f66\u0f0b\u0f54\u0f66\u0f0b\u0f51\u0f7a\u0f0b\u0f42\u0f4f\u0f7c\u0f44\u0f0b\u0f56\u0f62\u0f0b\u0f55\u0f63\u0f0b\u0f46\u0f7a\u0f62\u0f0b\u0f46\u0f74\u0f0b\u0f5a\u0f7c\u0f51\u0f0b\u0f62\u0f7a\u0f0b\u0f60\u0f42\u0f7c\u0f62\u0f0b\u0f66\u0fb2\u0f72\u0f51\u0f0d",
    "Your file '{file}' has been uploaded. Allow a few minutes for processing.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f61\u0f72\u0f42\u0f0b\u0f46\u0f0b '{file}' \u0f53\u0f44\u0f0b\u0f60\u0f47\u0f74\u0f42\u0f0b\u0f56\u0fb1\u0f66\u0f0b\u0f5f\u0f72\u0f53\u0f0d \u0f66\u0f90\u0f62\u0f0b\u0f58\u0f0b\u0f60\u0f42\u0f60\u0f72\u0f0b\u0f62\u0f72\u0f44\u0f0b\u0f51\u0f42\u0f0b\u0f66\u0f92\u0fb2\u0f72\u0f42\u0f0b\u0f56\u0fb1\u0f7a\u0f51\u0f0b\u0f46\u0f74\u0f42",
    "Your file has been deleted.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f61\u0f72\u0f42\u0f0b\u0f46\u0f0b\u0f56\u0f66\u0f74\u0f56\u0f0b\u0f5a\u0f62\u0f0b\u0f60\u0f51\u0f74\u0f42",
    "Your file {filename} is too large (max size: {maxSize}MB).": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f61\u0f72\u0f42\u0f0b\u0f46\u0f0b {filename} \u0f46\u0f7a\u0f0b\u0f51\u0fb2\u0f42\u0f66\u0f0b\u0f60\u0f51\u0f74\u0f42 (\u0f46\u0f7a\u0f66\u0f0b\u0f46\u0f7a\u0f0b\u0f64\u0f7c\u0f66\u0f0b: {maxSize}MB).",
    "Your message cannot be blank.": "\u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f50\u0f74\u0f44\u0f0b\u0f42\u0f72\u0f0b\u0f66\u0f92\u0f58\u0f0b\u0f66\u0f9f\u0f7c\u0f44\u0f0b\u0f56\u0f62\u0f0b\u0f60\u0f47\u0f7c\u0f42\u0f0b\u0f58\u0f72\u0f0b\u0f62\u0f74\u0f44\u0f0b\u0f0d",
    "Your message must have a subject.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f50\u0f74\u0f44\u0f0b\u0f63\u0f0b\u0f58\u0f42\u0f7c\u0f0b\u0f56\u0f62\u0f97\u0f7c\u0f51\u0f0b\u0f44\u0f7a\u0f66\u0f0b\u0f54\u0f62\u0f0b\u0f60\u0f47\u0f7c\u0f42\u0f0b\u0f51\u0f42\u0f7c\u0f66\u0f0d",
    "Your message must have at least one target.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f60\u0f55\u0fb2\u0f72\u0f53\u0f0b\u0f50\u0f74\u0f44\u0f0b\u0f63\u0f0b\u0f49\u0f74\u0f44\u0f0b\u0f58\u0f50\u0f62\u0f0b\u0f51\u0f58\u0f72\u0f42\u0f66\u0f0b\u0f60\u0f56\u0f7a\u0f53\u0f0b\u0f5e\u0f72\u0f42\u0f0b\u0f61\u0f7c\u0f51\u0f0b\u0f51\u0f42\u0f7c\u0f66\u0f0d",
    "Your policy changes have been saved.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f42\u0f66\u0f44\u0f0b\u0f62\u0f92\u0fb1\u0f60\u0f72\u0f0b\u0f66\u0fb2\u0f72\u0f51\u0f0b\u0f56\u0fb1\u0f74\u0f66\u0f0b\u0f56\u0f66\u0f92\u0fb1\u0f74\u0f62\u0f0b\u0f56\u0f45\u0f7c\u0f66\u0f0b\u0f56\u0fb1\u0f66\u0f0b\u0f54\u0f0b\u0f62\u0fa3\u0f58\u0f66\u0f0b\u0f49\u0f62\u0f0b\u0f5a\u0f42\u0f66\u0f0b\u0f56\u0fb1\u0f66\u0f0b\u0f61\u0f7c\u0f51\u0f0d",
    "Your post will be discarded.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f0b\u0f62\u0fa9\u0f7c\u0f58\u0f0b\u0f61\u0f72\u0f42\u0f0b\u0f60\u0f51\u0f7c\u0f62\u0f0b\u0f62\u0f92\u0fb1\u0f74\u0f0b\u0f61\u0f72\u0f53\u0f0d",
